// CreateQuiz.js (Fixed & Working)
import React, { useState } from "react";
import Navbar from "../components/Navbar";
import Sidebar from "../components/Sidebar";
import API from "../api";

export default function CreateQuiz() {
  const [title, setTitle] = useState("");
  const [questions, setQuestions] = useState([
    { text: "", options: ["", "", "", ""], correctIndex: 0 }
  ]);

  const handleQuestionChange = (index, field, value) => {
    const newQuestions = [...questions];
    if (field === "text") {
      newQuestions[index].text = value;
    } else if (field.startsWith("option")) {
      const optIndex = parseInt(field.replace("option", ""));
      newQuestions[index].options[optIndex] = value;
    } else if (field === "correctIndex") {
      newQuestions[index].correctIndex = parseInt(value);
    }
    setQuestions(newQuestions);
  };

  const addQuestion = () => {
    setQuestions([...questions, { text: "", options: ["", "", "", ""], correctIndex: 0 }]);
  };

  const submitQuiz = async () => {
    if (!title.trim()) return alert("Title required");
    if (questions.some(q => !q.text || q.options.some(o => !o))) return alert("Fill all fields");

    try {
      const res = await API.post("/quiz/create", { title, questions });
      alert("Quiz Created! Code: " + res.data.code);
      window.location = "/admin/quizzes";
    } catch (err) {
      alert("Error: " + (err.response?.data?.error || "Server error"));
    }
  };

  return (
    <>
      <Navbar />
      <div className="container-row">
        <Sidebar />
        <div className="content">
          <div className="card">
            <h2>Create Quiz</h2>
            <input
              placeholder="Quiz Title"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              style={{ width: "100%", padding: 10, margin: "10px 0" }}
            />

            {questions.map((q, i) => (
              <div key={i} style={{ border: "1px solid #444", padding: 15, margin: "15px 0" }}>
                <input
                  placeholder={`Question ${i + 1}`}
                  value={q.text}
                  onChange={(e) => handleQuestionChange(i, "text", e.target.value)}
                  style={{ width: "100%", padding: 8, marginBottom: 10 }}
                />
                {[0, 1, 2, 3].map((optIdx) => (
                  <input
                    key={optIdx}
                    placeholder={`Option ${optIdx + 1}`}
                    value={q.options[optIdx]}
                    onChange={(e) => handleQuestionChange(i, `option${optIdx}`, e.target.value)}
                    style={{ width: "100%", padding: 8, margin: "5px 0" }}
                  />
                ))}
                <select
                  value={q.correctIndex}
                  onChange={(e) => handleQuestionChange(i, "correctIndex", e.target.value)}
                  style={{ width: "100%", padding: 8, marginTop: 10 }}
                >
                  <option value={0}>Option 1 is Correct</option>
                  <option value={1}>Option 2 is Correct</option>
                  <option value={2}>Option 3 is Correct</option>
                  <option value={3}>Option 4 is Correct</option>
                </select>
              </div>
            ))}

            <button onClick={addQuestion}>Add Question</button>
            <button onClick={submitQuiz} style={{ marginLeft: 10, background: "#1976d2", color: "white" }}>
              Create Quiz
            </button>
          </div>
        </div>
      </div>
    </>
  );
}
